import axios from 'axios';
import React, { Component } from 'react'

export default class Login extends Component {
  constructor(props){
    super(props);
    this.state={
      Status:''
    }
  }
  handleSubmit=e=>{
    e.preventDefault();

    const data={
      Email:this.Email,
      Password:this.Password
    };
    axios.post('https://localhost:44385/api/Registration/Login',data)
    .then((res)=>{
      console.log(res)
      

      
      
    })
   
  }
  render() {
    return (
      <div>
        <center>
        <form onSubmit={this.handleSubmit}>
          <img  className="rand"src="data:image/jpeg;base64," alt=""/>
        <h3>Login</h3>
        <label>Email</label><br />
        <input type="text" onChange={e=>this.Email=e.target.value}/><br />
        <label>Password</label><br />
        <input type="text" onChange={e=>this.Password=e.target.value}/><br /><br />
        <button className="btn btn-primary ">Login</button>
        
        </form>
        </center>
      </div>
    )
  }
}
